/*==========================================
 Use Javascript to disable Calculate button
============================================*/

$( document ).ready(function() {
    $('input').keyup(function() {

        var empty = false;
        $('input').each(function() {
            if ($(this).val() == '') {
                empty = true;
            }
        });

        if (empty) {
            $('#calculate').attr('disabled', 'disabled');
        } else {
            $('#calculate').removeAttr('disabled');
        }
    });
})()
;
